// codeFrequencyService.js

import { setCodeFrequency } from './codeFrequencySlice';
import store from './store';

export const fetchCodeFrequency = async (owner, repo) => {
  try {
    const response = await fetch(`https://api.github.com/repos/${owner}/${repo}/stats/code_frequency`);
    const data = await response.json();
    store.dispatch(setCodeFrequency(data));
  } catch (error) {
    console.error('Error fetching code frequency:', error);
  }
};
